import React from 'react';
import { Container, AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import CreateTicket from './CreateTicket';
import UpdateTicketPrice from './UpdateTicketPrice';
import ValidateTicket from './ValidateTicket';

const App = () => {
  return (
    <Router>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            Ticket Management
          </Typography>
          <Button color="inherit" component={Link} to="/">
            Create Ticket
          </Button>
          <Button color="inherit" component={Link} to="/update-price">
            Update Ticket Price
          </Button>
          <Button color="inherit" component={Link} to="/validate-ticket">
            Validate Ticket
          </Button>
        </Toolbar>
      </AppBar>
      <Container>
        <Box mt={4}>
          <Switch>
            <Route exact path="/" component={CreateTicket} />
            <Route path="/update-price" component={UpdateTicketPrice} />
            <Route path="/validate-ticket" component={ValidateTicket} />
          </Switch>
        </Box>
      </Container>
    </Router>
  );
};

export default App;
